INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1110501043, /*drama_id*/1110501, /*command_type*/11, /*param_01*/111011, /*param_02*/"この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", /*param_03*/4, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
