INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1110501046, /*drama_id*/1110501, /*command_type*/11, /*param_01*/111011, /*param_02*/"しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", /*param_03*/4, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
